import React, { Component } from "react";
import axios from "axios";
import "antd/dist/antd.css";
import { Link } from 'react-router-dom';
import { Menu } from "antd";
import { Calendar } from 'antd';
import House from "../House/House";
const { SubMenu } = Menu;

function onPanelChange(value, mode) {
    console.log(value.format('YYYY-MM-DD'), mode);
  }

class MenuHorizontal extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      api: "http://localhost:1337",
    };
  }
  

  render() {
    return<div style={{marginLeft: '20px'}} className="row">
            <Menu mode="horizontal"style={{ width: 1500, 
              background: '#467fcf', fontFamily: 'Times New Roman',fontSize:'17px', color: '#fff'}}>
                <Menu.Item ><Link to="/" style={{color:'#fff'}}>Trang chủ</Link></Menu.Item>
                
                <SubMenu  title="Nhân Viên" style={{ width: 1500, 
              background: '#467fcf', fontFamily: 'Times New Roman',fontSize:'17px', color: '#fff'}}>
                    <Menu.Item > <Link to='/list' style={{}}>Phòng 1</Link> </Menu.Item>
                    <Menu.Item >Phòng 2</Menu.Item>
                </SubMenu>
                <SubMenu  title="Chấm Công">
                    <Menu.Item ><Link to="/home">Phòng 1</Link></Menu.Item>
                    <Menu.Item >Phòng 2</Menu.Item>
                </SubMenu>
            </Menu>
    </div>
    
  }
}

export default MenuHorizontal;
